import styled from 'styled-components/native';

export const Container = styled.View`
width: 100%;
height: 100%;
background-color: #dbdbdb;
align-items: center;
justify-content: center;
`;

export const Content = styled.View`
width: 100%;
height: 75%;
margin-top: 40px;
align-items: center;
justify-content: center;
`;

export const HomeContainer = styled.View`
align-items: center;
justify-content: center;
width: 100%;
height: 20%;
margin: 10px;
flex: 1;
flex-direction: row;
`;

export const HomeContent = styled.TouchableOpacity`
align-items: center;
justify-content: center;
background-color: #d9d9d9;
border-radius: 5px;
width: 45%;
height: 60%;
elevation: 2;
margin-left: 10px;
`;
